import React, { Component } from 'react'
import '../css/main.css';
// import profilepic from '../images/photo1.jpg'

export default class login extends Component {
    render() {
        return (
            
            <div>
                <link
                    rel="stylesheet"
                    href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css"
                    integrity="sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC"
                    crossorigin="anonymous"
                />
                {/* Main Content */}
                <div className="search">
                    <form action="">
                        <img src="agiliad-logo.png" alt=""></img>
                        <input className="prop small" type="text" name="username" id="username" placeholder="Username" />
                        <input className="prop small" type="password" name="password" id="password" placeholder="password" />
                        <input className="prop btnsubmit small" type="submit" value="Submit" />
                        <a href="#">Forgot password ?</a>
                    </form>
                </div>
                
            </div>
            
        )
    }
}
